import { Header } from './Header';
import { useLoadScript } from '@react-google-maps/api';
import { Map } from './Map';

export const Home = () => {
  const { isLoaded } = useLoadScript({
    googleMapsApiKey: process.env.GOOGLE_MAPS_API_KEY
  });

  return (
    <div>
      <Header />
      {isLoaded ? <div>Loading...</div> : <Map />}
    </div>
  );
};
